import React from 'react';
import Tabs from './Tabs';

function Home({ setPage }) {
  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4">Welcome Home</h2>
      <Tabs style={{ marginTop: '20px' }} />
      
    </div>
  );
}

export default Home;
